import React, { Component } from "react";

class Tasks extends Component {
  render() {
      const{tasks}=this.props
    return (
        <React.Fragment>
            <ul className='tasks'>
            {tasks.map((task)=>{
      return <li name='task' key={task.id} style={{height:'30px',padding:'10px',border:'1px solid grey',margin:'5px'}}>
        {task.content}
      </li>
            })
        }
            </ul>
  
      </React.Fragment>
    );
  }
}

export default Tasks;
